static void reloc_add_(uint8_t *ptr, uint32_t offset)
{
    uint32_t d;
    d = ptr[0] + (ptr[1]<<8) + (ptr[2]<<16) + (ptr[3]<<24);
    d += offset;
    ptr[0] = d & 0xff;
    ptr[1] = (d>>8) & 0xff;
    ptr[2] = (d>>16) & 0xff;
    ptr[3] = (d>>24) & 0xff;
}

static void _dorelocs(uint8_t *dat, struct reloc__ *reloc)
{
    int32_t offset = (int32_t)dat;
    while (reloc->kind != 0) {
        switch(reloc->kind) {
        case RELOC_KIND_I32:
            reloc_add_((uint8_t*)&dat[reloc->where], offset);
            break;
        }
        reloc++;
    }
}
